svg.script:
var transformMatrix = [1,0,0,1,0,0];

function applyMatrixUpdates()
{
        newMatrix = "matrix(" +  transformMatrix.join(' ') + ")";
        mapMatrix.setAttributeNS(null, "transform", newMatrix);
}

function panBy(x,y)
{
	transformMatrix[4] += x;
	transformMatrix[5] += y;
	applyMatrixUpdates();
}

function zoomBy(scale)
{
        for (var i=0; i<transformMatrix.length; i++)
        {
          transformMatrix[i] *= scale;
        }

	transformMatrix[4] += (1-scale)*width/2;
        transformMatrix[5] += (1-scale)*height/2;

	applyMatrixUpdates();
}

function resetMatrix()
{
	transformMatrix = [1,0,0,1,0,0];
	applyMatrixUpdates();
}

function init(evt)
{
    if ( window.svgDocument == null )
    {
	svgDocument = evt.target.ownerDocument;
    }

    mapMatrix = svgDocument.getElementById("zoomableArea");
    width  = evt.target.getAttributeNS(null, "width");
    height = evt.target.getAttributeNS(null, "height");

    tooltip = svgDocument.getElementById('tooltip');
    tooltip_bg = svgDocument.getElementById('tooltip_bg');

}

function ShowTooltip(evt, mouseovertext)
{
    tooltip.setAttributeNS(null,"x",evt.clientX+11);
    tooltip.setAttributeNS(null,"y",evt.clientY+10);
    tooltip.firstChild.data = mouseovertext;
    tooltip.setAttributeNS(null,"visibility","visible");

    length = tooltip.getComputedTextLength();
    tooltip_bg.setAttributeNS(null,"width",length+8);
    tooltip_bg.setAttributeNS(null,"x",evt.clientX+8);
    tooltip_bg.setAttributeNS(null,"y",evt.clientY-10);
    tooltip_bg.setAttributeNS(null,"visibility","visibile");
}

function HideTooltip(evt)
{
    tooltip.setAttributeNS(null,"visibility","hidden");
    tooltip_bg.setAttributeNS(null,"visibility","hidden");
}
